import React from 'react';
import './App.css';
import FilterableProductTable from './FilterableProductTable'

const PRODUCTS = [
  {category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football"},
  {category: "Sporting Goods", price: "$9.99", stocked: true, name: "Baseball"},
  {category: "Sporting Goods", price: "$29.99", stocked: false, name: "Basketball"},
  {category: "Electronics", price: "$99.99", stocked: true, name: "iPod Touch"},
  {category: "Electronics", price: "$399.99", stocked: false, name: "iPhone 5"},
  {category: "Electronics", price: "$199.99", stocked: true, name: "Nexus 7"},
  {category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football2"},
  {category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football2"},
  {category: "Sporting2 Goods", price: "$49.99", stocked: true, name: "Football13"},
  {category: "Sporting2 Goods", price: "$49.99", stocked: true, name: "Footbal41"},
  {category: "Sporting2 Goods", price: "$49.99", stocked: true, name: "Football24"}

];

function App() {
  return (
    <div className="App">
      <FilterableProductTable products={PRODUCTS} />
    </div>
  );
}

export default App;
